import DoDisturbIcon from '@mui/icons-material/DoDisturb';import { Button, Card, CardContent, Dialog, DialogTitle, Icon, IconButton, TextField, Typography } from "@mui/material";
import CheckIcon from '@mui/icons-material/Check';
import axios from "axios";
import { useState } from "react";
import globals from "../../Services/Globals";
import "./Main.css";



export interface SimpleDialogProps {
    open: boolean;
    result: boolean;
    onClose: (value: string) => void;
  }


  export default function SimpleDialogDemo() {
    const [open, setOpen] = useState(false);

    const handleClickOpen = () => {
      setOpen(true);
    };

    const handleClose = () => {
      setOpen(false);
    };  

    const [phone, setPhone] = useState<string>("");
    const [result, setResult] = useState<boolean>();
    const okMessage = "מספר זה אינו רשום למאגר. ניתן לבצע שיחת טלמרקטינג.";
    const noMessage = "מספר זה רשום למאגר. לא ניתן לבצע שיחת טלמרקטינג";
    const phoneQuery = async () => {

         axios.get<boolean>(globals.urls.phoneQuery + phone)

         .then((res) => {
            setResult(res.data)
            setOpen(true);
         })
         ;
      }

    return (
        <div className="Main">  

       <Dialog open={open}>
        <DialogTitle>תוצאות הבדיקה</DialogTitle>
        {(result == true) ? 
         <DoDisturbIcon />

        : 
        <DoDisturbIcon />
}
            <Typography>{
            (result == true) ? okMessage : noMessage
            }</Typography>

            <Button onClick={handleClose}> close </Button>
      </Dialog>


        <Card sx={{ m: 15 }}>
                <Typography sx={{mt: 5}}>
                   הזן מספר טלפון לבדיקה
                </Typography>

            <CardContent>
        <TextField
         fullWidth 
         variant="filled" 
         onChange={e => (setPhone(e.target.value))
        }
         />
        <Button sx={{ m: 3 }} variant="contained" color="primary" onClick={phoneQuery}> בדיקה במאגר</Button>
        </CardContent>
        </Card>
        </div>
    );
}
